import { useOutletContext } from "react-router-dom";
import { GoToMainProps } from "../Root";
import { useForm } from "react-hook-form";
import LogoSVG from "../components/LogoSVG";

import {
  Wrapper,
  Logo,
  Form,
  Title,
  Text,
  InputWrapper,
  Input,
  Desc,
  Submit,
  VerificationWrapper,
} from "../styles/loginSignup.styled";

const Signup = () => {
  const { goToMain } = useOutletContext<GoToMainProps>();

  const {
    register,
    handleSubmit,
    formState: { errors },
    setError,
    getValues,
  } = useForm();

  const onValid = async () => {};

  return (
    <Wrapper>
      <Logo onClick={goToMain}>
        <LogoSVG />
      </Logo>
      <Form onSubmit={handleSubmit((data) => console.log(data))}>
        <Title>MOVING 회원가입</Title>
        <Text>아이디와 이메일로 간편하게 무빙을 시작하세요</Text>
        <InputWrapper>
          <Input
            {...register("id", { required: "아이디를 입력해주세요." })}
            placeholder="아이디"
            type="text"
          />
          <Desc>영문 소문자 또는 영문 소문자, 숫자 조합 6~12자리</Desc>

          <Input
            {...register("password", { required: "비밀번호를 입력해주세요." })}
            type="password"
            placeholder="비밀번호"
          />
          <Input type="password" placeholder="비밀번호 확인" />
          <Desc>영문, 숫자, 특수문자 조합 8~15 자리</Desc>

          <Input type="email" placeholder="이메일" />

          <VerificationWrapper>
            <Input type="text" placeholder="휴대폰 번호" />
            <Input type="submit" value={"인증번호 전송"} />
          </VerificationWrapper>
        </InputWrapper>
        <Submit type="submit" value={"회원가입하기"} />
      </Form>
    </Wrapper>
  );
};

export default Signup;
